function getDialogCount(t){return Number(t.getAttribute("data-dialog-count"))||0}function setDialogCount(t,e){t.setAttribute("data-dialog-count",e.toString())}function traverseActiveElements(t=document.activeElement){return null!=t&&null!=t.shadowRoot&&null!=t.shadowRoot.activeElement?traverseActiveElements(t.shadowRoot.activeElement):t}export{getDialogCount,setDialogCount,traverseActiveElements};